import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const date1 = new Date().getHours();
var greeting = '';
var cssStyle = { };

if(date1 > 0 && date1 < 12){
    greeting = 'Good morning !';
}
else if(date1 >= 12 && date1 < 16){
    greeting = 'Good AfterNoon !!';
}
else if(date1 >= 16 && date1 < 20){
    greeting = 'Good Evening !!';
}
else{
    greeting = 'Good Night !!';
}

ReactDOM.render(
    <h1>Hello Sir, {greeting} </h1>,
    document.getElementById("root")
);
